import React from "react";

const Day25 = (props) => {
  return (
    <div className="day">
      <h2>May 25</h2>
      <h3>Can Marcer and Sitges</h3>

      <div>
        <p>Today we will be checking into the Can Marcer de la Penya in Sitges. This will be the venue for the wedding, and our home base over the next few days.</p>
        <p>Lot's of people will likely be arriving in Spain today, so we've left today as a beach day in Sitges to explore and hang out. This is a wonderful town full of lively restaurants/bars, and history</p>
      </div>

      <div>
        <h4>Hotel Recommendations in Sitges:</h4>
        <ul>
          <li><a href=''>Hotel Platja</a></li>
        </ul>
      </div>
    </div>
  );
};

